  return (
    <div className="Countries-container">
      <h3>Countries</h3>
      {myCountries.map((country)=> {
        return(
          <div className="Country-container">
            <Link to={'/details/${country.cca3}'}>
              <div key={country.cca3}>
                <h4>[</h4>

              </div>
            </Link>

          </div>
        )
      })
    }
    </div>
  )
}
